import './Register.css'

function Register() {
  return (
    <div class="register">
        <div class="id">
          <input type="text" placeholder="아이디를 입력해주세요" class="id"/><button type="button" class="btn_check">중복체크</button>
        </div>
    </div>
  );
}

export default Register;
